import React, { Component } from 'react'
import Modal from 'react-modal';
import axios from 'axios'


const customStyles = {
  content: {
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    marginRight: '-50%',
    transform: 'translate(-50%, -50%)',
  },
};
 class Header extends Component {
constructor(){
  super();
  this.state={
    backgroundcolor:'',
    display:'none',
    loginModalIsOPen:false,
    username: undefined,
    isLoggedin:false,
    imageUrl:undefined,
    loading:false,
    signupModalOpen:false,
    signinModalOpen:false,
    email:undefined,
    password:undefined,
    confirmpassword:undefined,
    signupError:"",
  }
}
handleSignup=()=>{
  this.setState({signupModalOpen:true});
  }

  closeSignupModal=()=>{
    this.setState({signupModalOpen:false,signupError:"",loading:false});
  }

handlesSignupFields=(event)=>{
  let name=event.target.name;
  let value=event.target.value;
  this.setState({[name]:value})
}

handelLoginFields=(event)=>{
  let name=event.target.name;
  let value=event.target.value;
  this.setState({[name]:value});
}

handleSignupForm=(event)=>{
  event.preventDefault();
  const {passwrod,confirmpassword} = this.state;
  let condition =true;
  if(password !== confirmpassword){
    condition =false;
    this.setState({signupError:"password doesn't  match"});
  }
}





  handelLogin =()=>{
    this.setState({loginModalIsOPen:true });
  }
  handelcancel=()=>{
    this.setState({loginModalIsOPen:false })
  }





  render() {
    const {loginModalIsOPen}=this.state;
    const {signinModalOpen,signupModalOpen,isLoggedin,username,imageUrl,handleEmptyCard,openCard,cardMenuitems,loading}=this.state
    return (
      <div>
                 <div className="topRedBand">
        <span>
            <div className="logoE">e!</div>
        </span>
       
        <div className="twoButtons">
                <div  className="loginButton" onClick={this.handelLogin}>login</div>
                <div  className="createAccountButton" onClick={this.handleSignup}>Create an Account</div>
           </div>
      
    </div>
    <Modal
        isOpen={loginModalIsOPen}
        style={customStyles}
      
      >
        
        <div className='loginbox'>
       <h2>login</h2>
       <input type="text" placeholder='email'  ></input>
       <input type="text" placeholder='password'/>
       <div>
        <button>login</button>
        <button onClick={this.handelcancel}>cancel</button> 
        <form className='login-form' onSubmit={this.handleSignupForm}>

          <div className='sign-with' style={{justifyContent:'noraml'}}>sign up</div>
          <div style={{color:'red',textAlign:'center'}}>{loading ? null : this.state.signupError}</div>

          <div className='wrap-input100 validate-input alert-validation' data-validate="username is require">
            <input class="input100 form-control" type='text' name="username" onChange={this.handlesSignupFields} placeholder='full name' required></input>
          </div>

          
          <div className='wrap-input100 validate-input alert-validation' data-validate="username is require">
            <input class="input100 form-control" type='text' name="email" onChange={this.handlesSignupFields} placeholder='email' required></input>
          </div>
          
          <div className='wrap-input100 validate-input alert-validation' data-validate="username is require">
            <input class="input100 form-control" type='text' name="password" onChange={this.handlesSignupFields} placeholder='full name' required></input>
          </div>

          
          <div className='wrap-input100 validate-input alert-validation' data-validate="username is require">
            <input class="input100 form-control" type='text' name="confirm password" onChange={this.handlesSignupFields} placeholder='confirm password ' required>  </input>
          </div>
        {/* <div style={{marginTop:'17px'}}>
          <button type="submit" className='login-submit' disabled={loading}>create Account</button>
        </div>

        <div style={{marginTop:'17px'}}>
        <div type="submit" className='login-submit' disabled={loading}>already hava an accound</div>
        </div> */}
        </form>
       </div>
       </div>
      </Modal>
      </div>
    )
  }
}
export default Header
